INSERT INTO `tbl_lessons` (`id`, `subject_id`, `name`, `description`, `content`, `image`, `status_id`, `created_at`, `updated_at`, `delete_at`) VALUES
(1, 1, 'Python Data Types', 'Introduction to Python data types', 'This lesson covers the various data types in Python, including integers, floats, strings, and booleans. It also covers type conversion and basic operators.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(2, 1, 'Python Control Structures', 'Introduction to Python control structures', 'This lesson covers the use of control structures in Python, including if-else statements, loops, and functions. It also covers basic debugging techniques.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(3, 1, 'Python Modules and Libraries', 'Introduction to Python modules and libraries', 'This lesson covers the use of modules and libraries in Python, including importing and using built-in and external modules and libraries. It also covers package management using pip.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(4, 2, 'HTML Tags and Elements', 'Introduction to HTML tags and elements', 'This lesson covers the various HTML tags and elements used to create web pages, including headings, paragraphs, images, links, and lists. It also covers basic page structure and formatting.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(5, 2, 'CSS Styling and Layout', 'Introduction to CSS styling and layout', 'This lesson covers the use of CSS to style and layout web pages, including basic selectors, properties, and values. It also covers box model and layout techniques.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(6, 2, 'JavaScript Basics', 'Introduction to JavaScript basics', 'This lesson covers the basics of JavaScript, including variables, data types, operators, and control structures. It also covers basic debugging techniques and the use of the console.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(7, 3, 'Database Design', 'Introduction to database design', 'This lesson covers the principles of database design, including entity-relationship models, normalization, and data modeling. It also covers basic SQL queries.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(8, 3, 'MySQL Administration', 'Introduction to MySQL administration', 'This lesson covers the administration of MySQL databases, including installation, configuration, and backup and recovery. It also covers basic database security.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(9, 3, 'Advanced SQL Queries', 'Introduction to advanced SQL queries', 'This lesson covers advanced SQL queries, including subqueries, joins, and aggregate functions. It also covers stored procedures and views.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(10, 4, 'Software Development Lifecycle', 'Introduction to software development lifecycle', 'This lesson covers the software development lifecycle, including requirements gathering, design, implementation, testing, and deployment. It also covers project management techniques.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(11, 4, 'Object-Oriented Programming Principles', 'Introduction to object-oriented programming principles', 'This lesson covers the principles of object-oriented programming, including classes, objects, inheritance, and polymorphism. It also covers basic design patterns.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(12, 4, 'Version Control with Git', 'Introduction to version control with Git', 'This lesson covers version control with Git, including installation, configuration, and basic commands. It also covers basic collaboration using GitHub.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(13, 5, 'Introduction to Artificial Intelligence', 'Introduction to artificial intelligence', 'This lesson covers the basics of artificial intelligence, including machine learning, deep learning, and natural language processing. It also covers ethical considerations.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(14, 5, 'Data Preprocessing and Feature Engineering', 'Introduction to data preprocessing and feature engineering', 'This lesson covers data preprocessing and feature engineering techniques used in machine learning, including data cleaning, normalization, and feature selection. It also covers data visualization.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(15, 5, 'Neural Networks and Deep Learning', 'Introduction to neural networks and deep learning', 'This lesson covers the basics of neural networks and deep learning, including feedforward, convolutional, and recurrent neural networks. It also covers regularization and optimization techniques.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(16, 6, 'Introduction to Data Science', 'Introduction to data science', 'This lesson covers the basics of data science, including data acquisition, cleaning, and visualization. It also covers statistical analysis and machine learning techniques.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(17, 6, 'Data Wrangling and EDA', 'Introduction to data wrangling and exploratory data analysis', 'This lesson covers data wrangling and exploratory data analysis techniques used in data science, including data cleaning, transformation, and visualization. It also covers hypothesis testing and statistical inference.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(18, 6, 'Supervised Learning', 'Introduction to supervised learning', 'This lesson covers supervised learning techniques used in data science, including linear regression, logistic regression, decision trees, and random forests. It also covers model evaluation and selection.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(19, 7, 'Introduction to Cloud Computing', 'Introduction to cloud computing', 'This lesson covers the basics of cloud computing, including cloud models, service models, and deployment models. It also covers cloud providers and security considerations.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(20, 7, 'Cloud Infrastructure', 'Introduction to cloud infrastructure', 'This lesson covers cloud infrastructure components, including compute, storage, and networking. It also covers virtualization and containerization.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(21, 7, 'Cloud Services and Applications', 'Introduction to cloud services and applications', 'This lesson covers cloud services and applications, including database as a service, platform as a service, and software as a service. It also covers deployment and scaling techniques.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(22, 8, 'Introduction to Cybersecurity', 'Introduction to cybersecurity', 'This lesson covers the basics of cybersecurity, including threats, vulnerabilities, and risks. It also covers security policies and standards.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(23, 8, 'Network Security', 'Introduction to network security', 'This lesson covers network security, including firewalls, intrusion detection and prevention systems, and virtual private networks. It also covers secure protocols and encryption.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(24, 8, 'Web Application Security', 'Introduction to web application security', 'This lesson covers web application security, including authentication, authorization, and session management. It also covers common web application attacks and defenses.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(25, 9, 'Introduction to Digital Marketing', 'Introduction to digital marketing', 'This lesson covers the basics of digital marketing, including search engine optimization, search engine marketing, and social media marketing. It also covers email marketing and content marketing.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(26, 9, 'Web Analytics and ROI', 'Introduction to web analytics and return on investment', 'This lesson covers web analytics and return on investment in digital marketing, including website traffic analysis, conversion tracking, and revenue attribution. It also covers A/B testing and optimization strategies.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(27, 9, 'Marketing Automation', 'Introduction to marketing automation', 'This lesson covers marketing automation, including lead generation, lead nurturing, and lead scoring. It also covers marketing automation tools and techniques.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(28, 10, 'Introduction to Project Management', 'Introduction to project management', 'This lesson covers the basics of project management, including project planning, execution, monitoring, and control. It also covers project scope, schedule, and budget management.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(29, 10, 'Agile Project Management', 'Introduction to agile project management', 'This lesson covers agile project management, including agile methodologies, such as Scrum and Kanban. It also covers agile project planning and estimation techniques.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(30, 10, 'Project Management Tools', 'Introduction to project management tools', 'This lesson covers project management tools, including project management software, such as Microsoft Project and Jira. It also covers collaboration and communication tools.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(31, 1, 'Python Functions', 'Introduction to Python functions', 'This lesson covers the use of functions in Python, including defining, calling, and passing arguments to functions. It also covers recursion and lambda functions.', 'https://picsum.photos/200/300', 17, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(32, 1, 'Python File Handling', 'Introduction to Python file handling', 'This lesson covers file handling in Python, including reading and writing files, and using file objects. It also covers exception handling.', 'https://picsum.photos/200/300', 18, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL),
(33, 1, 'Python Web Scraping', 'Introduction to Python web scraping', 'This lesson covers web scraping in Python, including using libraries such as BeautifulSoup and Scrapy. It also covers web crawling and data extraction.', 'https://picsum.photos/200/300', 19, '2023-06-20 14:09:57', '2023-06-20 14:09:57', NULL);
